// src/pages/DailyChallenge/DailyChallenge.js
import React, { useState } from "react";
import { Link } from "react-router-dom";

const DailyChallenge = () => {
  const [showWheel, setShowWheel] = useState(false);
  const [streak, setStreak] = useState(3); // mock value
  const [weekProgress, setWeekProgress] = useState([
    "‚úÖ",
    "‚úÖ",
    "‚úÖ",
    "",
    "",
    "",
    "",
  ]);

  const handleStartWorkout = () => {
    // Mock completion logic
    const updatedProgress = [...weekProgress];
    const todayIndex = new Date().getDay(); // 0 (Sun) to 6 (Sat)
    updatedProgress[todayIndex === 0 ? 6 : todayIndex - 1] = "‚úÖ";
    setWeekProgress(updatedProgress);

    setStreak(streak + 1); // Increase streak
    setShowWheel(true); // Show Bonus Wheel
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.title}>Daily Challenge</h2>
      <p style={styles.subtitle}>
        Complete your daily workout to gain XP and improve your fitness.
      </p>

      {/* üî• Streak Tracker */}
      <div style={styles.card}>
        <h3>üî• Current Streak</h3>
        <p style={styles.streakText}>{streak} Days</p>
        <p style={styles.hint}>
          Reach 5 days to earn the{" "}
          <span style={styles.highlight}>Consistency Badge</span>!
        </p>
      </div>

      {/* üóìÔ∏è Weekly Calendar */}
      <div style={styles.card}>
        <h3>üóìÔ∏è Weekly Progress</h3>
        <div style={styles.calendarRow}>
          {["Mon", "Tue", "Wed", "Thu", "Fri", "Sat", "Sun"].map((day, i) => (
            <div
              key={day}
              style={{
                ...styles.dayBox,
                backgroundColor: weekProgress[i] === "‚úÖ" ? "#28a745" : "#ccc",
                color: weekProgress[i] === "‚úÖ" ? "#fff" : "#000",
              }}
            >
              {day} {weekProgress[i]}
            </div>
          ))}
        </div>
      </div>

      {/* ‚úÖ Start Workout */}
      <button onClick={handleStartWorkout} style={styles.startButton}>
        Start Workout
      </button>

      {/* üé° Bonus Wheel */}
      {showWheel && (
        <div style={styles.card}>
          <h3>üé° Spin the Bonus Wheel!</h3>
          <button
            onClick={() => alert("üéâ You won +50 XP!")}
            style={styles.spinButton}
          >
            Spin Now
          </button>
          <p style={styles.hint}>Win XP boosts, power-ups, and more!</p>
        </div>
      )}

      {/* Back to Map */}
      <Link to="/adventure-map" style={styles.backLink}>
        ‚Üê Back to Adventure Map
      </Link>
    </div>
  );
};

const styles = {
  container: {
    maxWidth: "700px",
    margin: "40px auto",
    padding: "20px",
    textAlign: "center",
    fontFamily: "Arial, sans-serif",
  },
  title: {
    fontSize: "32px",
    fontWeight: "bold",
    marginBottom: "10px",
  },
  subtitle: {
    fontSize: "16px",
    color: "#555",
    marginBottom: "30px",
  },
  card: {
    backgroundColor: "#f5f5f5",
    borderRadius: "12px",
    padding: "20px",
    marginBottom: "20px",
    boxShadow: "0 4px 10px rgba(0,0,0,0.1)",
  },
  streakText: {
    fontSize: "24px",
    color: "#28a745",
    fontWeight: "bold",
  },
  hint: {
    fontSize: "14px",
    color: "#555",
    marginTop: "6px",
  },
  highlight: {
    color: "#ffa500",
    fontWeight: "bold",
  },
  calendarRow: {
    display: "grid",
    gridTemplateColumns: "repeat(7, 1fr)",
    gap: "8px",
    marginTop: "15px",
  },
  dayBox: {
    padding: "10px",
    borderRadius: "8px",
    fontWeight: "bold",
  },
  startButton: {
    marginTop: "20px",
    padding: "12px 25px",
    backgroundColor: "#28a745",
    color: "white",
    border: "none",
    borderRadius: "8px",
    fontSize: "16px",
    cursor: "pointer",
    fontWeight: "600",
  },
  spinButton: {
    marginTop: "10px",
    padding: "10px 20px",
    backgroundColor: "#ffd700",
    color: "#000",
    border: "none",
    borderRadius: "8px",
    fontWeight: "600",
    cursor: "pointer",
  },
  backLink: {
    display: "inline-block",
    marginTop: "25px",
    textDecoration: "none",
    color: "#007bff",
    fontWeight: "600",
  },
};

export default DailyChallenge;
